import React from "react";

const About = () => {
  return (
    <div
      style={{
        display: "flex",
        alignItems: "center",
        flexDirection: "column",
        marginTop: "40px",
      }}
    >
      <h1>About This App</h1>
      <h3>This is a customer database project for Jitesh</h3>
    </div>
  );
};
export default About;
